import React from 'react'

export const LocationinCity = () => {

    const del_laxmi = ()=>{
        history.push({
            pathname:"./propertylist",
            state:{
                area:"laxmi nagar"
            }
        })
     }


    return (
       <>
        <li class="roundbtn"> 
       <button class="btn btn-outline-secondary" type="button" onClick={del_laxmi} >laxminagar</button>
       </li>
       </>
    )
}
